B.GP=new A.en("Amigo Invisible Santa Secreto no recopila ninguna informaci\xf3n personal de los usuarios. No se recopilan nombres, direcciones de correo electr\xf3nico, ubicaci\xf3n u otra informaci\xf3n identificable.",null)
B.Lf=new A.ep("3. Uso de la informaci\xf3n:",null)
B.GO=new A.en("Dado que no recopilamos informaci\xf3n personal, no utilizamos ning\xfan dato de usuario.",null)
B.La=new A.ep("4. Compartir informaci\xf3n:",null)
B.GL=new A.en("Amigo Invisible Santa Secreto no comparte informaci\xf3n con terceros, ya que no se recopila informaci\xf3n de los usuarios.",null)
B.Le=new A.ep("5. Seguridad:",null)
B.GN=new A.en("A pesar de que no recopilamos informaci\xf3n de los usuarios, nos tomamos muy en serio la seguridad. La aplicaci\xf3n est\xe1 dise\xf1ada con medidas de seguridad para proteger la privacidad de nuestros usuarios.",null)
B.L7=new A.ep("6. Opciones del usuario:",null)
B.GI=new A.en("Dado que no recopilamos informaci\xf3n personal, los usuarios no tienen opciones relacionadas con sus datos en nuestra aplicaci\xf3n.",null)
B.Ld=new A.ep("7. Enlaces a terceros:",null)
B.GQ=new A.en("Amigo Invisible Santa Secreto no contiene enlaces a sitios web de terceros. La aplicaci\xf3n es independiente y no dirige a los usuarios a ning\xfan sitio externo.",null)
B.L8=new A.ep("8. Cambios en la pol\xedtica de privacidad:",null)
B.GM=new A.en("Dado que no anticipamos cambios en nuestra pol\xedtica de privacidad, no habr\xe1 modificaciones en el futuro. Esta pol\xedtica es aplicable en todo momento mientras uses Amigo Invisible Santa Secreto.",null)
B.Lb=new A.ep("9. Contacto:",null)
B.GH=new A.en("Si tienes alguna pregunta o inquietud sobre nuestra pol\xedtica de privacidad o el uso de Amigo Invisible Santa Secreto, no dudes en ponerte en contacto con nosotros en ossyyrr@gmail.com.",null)
B.Lg=new A.ep("10. Fecha de entrada en vigencia: ",null)
B.GK=new A.en("Esta pol\xedtica de privacidad entra en vigencia a partir del 30 de Septiembre, 2023.",null)
